/* eslint-disable arrow-body-style */
import React from 'react';
import styled from 'styled-components';

const SearchResultContainer = styled.div`
  height: 100%;
`;

const SearchResult = () => {
  return (
    <SearchResultContainer>
      <h3>Search results.</h3>
    </SearchResultContainer>
  );
};

export default SearchResult;
